import React from "react";
import "./styles/styles.css";

import Navbar from "./components/Navbar";
import HeroBanner from "./components/HeroBanner";
import Features from "./components/Features";
import Services from "./components/Services";
import Pricing from "./components/Pricing";
import Download from "./components/Download";
import Footer from "./components/Footer";

export default function App() {
  return (
    <>
      <Navbar />
      <main>
        <HeroBanner />
        <div style={{ width: "100%", height: "700px", backgroundColor: "#fffbcc", display: "flex", flexDirection: "column", justifyContent: "center", alignItems: "center" }}>
          <iframe style={{ padding: "24px" }} width="560" height="315" src="https://www.youtube.com/embed/eBCmgUL-Me8?autoplay=1&mute=1" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
          <span style={{ marginTop: "24px" }}>리플하다는 플라스틱을 줄이기 위해 다회용기 순환 프로세스를 구축하였습니다</span>
        </div>

        <div style={{ width: "100%", height: "500px", backgroundColor: "#fff", display: "flex", flexDirection: "column", justifyContent: "center", alignItems: "center" }}>
          <span style={{ marginTop: "24px" }}>모바일 앱으로 실천하는 제로 웨이스트</span>
          <span style={{ marginTop: "24px" }}>리플하다는 하루에 5만톤씩 버려지는 일회용기를 리플하다의 다회용기로 대체해나가고 있습니다. 환경을 생각하는 소비자가 조금 더 편하게 친환경을 실천 할 수 있도록, 미래를 생각하는 가맹점이 쉬운 결정을 내릴수 있도록,  다회용기 순환의 엔드투엔드 서비스를 제공합니다. </span>
        </div>

        <Features />
        <Services />
        <Pricing />
        <Download />
      </main>
      <Footer />
    </>
  );
}
